import { FlatList } from 'react-native'

export const Container = styled.div`
  display: flex;
  flex: 1;
  background-color: #ffffff;
`;

export const ButtonFeed = styled.TouchableOpacity`
  background-color: #0669de;
  top: 0;
  width: 100%;
  color: #fff;
  font-size: 16px;

`;


